(2640, 'ptBR', 'Caldeirão da Carnificina', 'A História já testemunhou muitas guerras épicas, mas nenhuma foi mais explosiva que a rivalidade entre o gorila galvânico Torq, a Tormenta, e o mecassauro derretido Flarendo, o Furioso. Esta noite vale tudo quando esses dois campeões se enfrentarem no caldeirão num embate que ameaça partir a Inframina ao meio! Testemunhe a carnificina ou seja uma vergonha para o povo goblínico.', 59888);
