(30331, 'ptBR', 'Visão Geral', 'Flarendo e Torq dão um espetáculo para a plateia, lançando |cFF2959D3|Hspell:473650|h[Bombas de Sucata]|h|r e aplicando |cFF2959D3|Hspell:473951|h[Carga Estática]|h|r nos combatentes da arena. \nCom 100 de energia, Flarendo e Torq se juntam em uma |cFF2959D3|Hspell:465833|h[Colisão Colossal]|h|r!', 59888),
(27555, 'ptBR', 'Curadores', '$bullet; Ao expirar, |cFF2959D3|Hspell:424739|h[Corrupção Caótica]|h|r irrompe e salta para o jogador mais próximo.\n$bullet;|cFF2959D3|Hspell:424739|h [Corrupção Caótica]|h|r causa dano periódico moderado ao alvo atual.\n$bullet;|cFF2959D3|Hspell:425052|h [Gravidade Sombria]|h|r causa dano moderado a todos os jogadores por toda a duração.', 59888),
(30489, 'ptBR', 'Causadores de Dano', '$bullet;|cFF2959D3|Hspell:465952|h[Bando de Bomba Bombadona]|h|r e |cFF2959D3|Hspell:1214607|h[Bombardeio Bombástico Bombadão]|h|r também acionam a |cFF2959D3|Hspell:466158|h[Bolsa de Sapador]|h|r e |cFF2959D3|Hspell:1214755|h[Foguetes Sobrecarregados]|h|r.\n$bullet;Técnicos Sombrafuso à beira da morte soltam Gigabombas que causam um |cFF2959D3|Hspell:1223905|h[GigaBUM!]|h|r após $1223905D. O |cFF2959D3|Hspell:469327|h[Gigaimpacto]|h|r de Gallywix provoca a detonação imediata delas.\n$bullet;|cFF2959D3|Hspell:469362|h[Gigabombas Carregadas]|h|r levadas aos Gigacontroles ativam a |cFF2959D3|Hspell:469767|h[Detonação da Gigabomba]|h|r, causando o |cFF2959D3|Hspell:1220846|h[Derretimento do Controle]|h|r, o que interrompe as |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r de Gallywix.\n$[15,16$bullet;A Sentinela Tirocerto pode causar dano elevado com |cFF2959D3|Hspell:466834|h[Barragem Chocante]|h|r quando fica sem controle.$]', 59888),
(30488, 'ptBR', 'Curadores', '$bullet;Jogadores afetados por |cFF2959D3|Hspell:1220761|h[Latas do Mecaengenheiro]|h|r explodem após o consumo ou a expiração, causando uma |cFF2959D3|Hspell:474447|h[Detonação da Lata]|h|r.\n$bullet;Técnicos Sombrafuso à beira da morte soltam Gigabombas que causam um |cFF2959D3|Hspell:1223905|h[GigaBUM!]|h|r após $1223905D. O |cFF2959D3|Hspell:469327|h[Gigaimpacto]|h|r de Gallywix provoca a detonação imediata delas.\n$bullet;|cFF2959D3|Hspell:469362|h[Gigabombas]|h|r levadas aos Gigacontroles ativam a |cFF2959D3|Hspell:469767|h[Detonação da Gigabomba]|h|r, causando o |cFF2959D3|Hspell:1220846|h[Derretimento do Controle]|h,|r o que interrompe as |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r de Gallywix.\n$bullet;|cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r, |cFF2959D3|Hspell:466338|h[Sapeca Iá Iá]|h|r e |cFF2959D3|Hspell:1214369|h[DESTRUIÇÃO TOTAL!!!]|h|r causam dano considerável.', 59888),
(30487, 'ptBR', 'Tanques', '$[15,16$bullet;|cFF2959D3|Hspell:465952|h[Bando de Bomba Bombadona]|h|r e |cFF2959D3|Hspell:1214607|h[Bombardeio Bombástico Bombadão]|h|r também criam |cFF2959D3|Hspell:466165|h[Bomba FALH-4 de 700 kg]|h|r.$]\n$bullet;|cFF2959D3|Hspell:466340|h[Latas de Fragmentação]|h|r e |cFF2959D3|Hspell:1214607|h[Bombardeio Bombástico Bombadão]|h|r afetam jogadores à frente de Gallywix.\n$bullet;Técnicos Sombrafuso à beira da morte soltam Gigabombas que causam um |cFF2959D3|Hspell:1223905|h[GigaBUM!]|h|r após $1223905D. O |cFF2959D3|Hspell:469327|h[Gigaimpacto]|h|r de Gallywix provoca a detonação imediata delas.\n$bullet;Gallywix solta todos os |cFF2959D3|Hspell:1220290|h[Tiros de Mestre]|h|r ao chegar a $1220290s2 cargas ou ao mudar de alvo primário.', 59888),
