(31173, 'ptBR', 'Intervalo: Atracado e Carregado', 'Gallywix cai na arena, com uma |cFF2959D3|Hspell:1214226|h[Craterização]|h|r em quem estiver no caminho, ganhando |cFF2959D3|Hspell:1214229|h[Blindagem à Prova de Armagedom]|h|r e lança |cFF2959D3|Hspell:1214369|h[Destruição Total!!!]|h|r até ser interrompido.', 59888),
