(27557, 'ptBR', 'Seção 6', '', 59888),
(31956, 'ptBR', 'Causadores de Dano', '$bullet;|cFF2959D3|Hspell:468846|h[Centelhas Saltitantes]|h|r perseguem os jogadores e os atordoam ao contato.\n$bullet;|cFF2959D3|Hspell:465279|h[Água da Barragem]|h|r se eletrifica em contato com as habilidades de raios do Guizol.\n$bullet;|cFF2959D3|Hspell:465463|h[Investida Turbo]|h|r e |cFF2959D3|Hspell:468813|h[Gigafulminação]|h|r causam dano pesado.', 59888),
(31102, 'ptBR', 'Tanques', '$bullet; Rik |cFF2959D3|Hspell:466128|h[Ressoa]|h|r mais potência aos amplificadores próximos. \n$bullet; |cFF2959D3|Hspell:464488|h[Impacto Sônico]|h|r causa dano Sônico em uma área cônica frontal e aplica |cFF2959D3|Hspell:464518|h[Zunido]|h|r. O dano Sônico não pode ser bloqueado nem reduzido pela Armadura.\n$bullet; As |cFF2959D3|Hspell:466722|h[Explosões]|h|r dos amplificadores lançam os jogadores para cima, e Rik gera |cFF2959D3|Hspell:467991|h[Escalas Descendentes]|h|r letais.', 59888),
(30506, 'ptBR', 'Tanques', '$bullet;|cFF2959D3|Hspell:466518|h[Soqueira de Ouro Derretido]|h|r causa dano elevado à frente de Mag e aplica |cFF2959D3|Hspell:467202|h[Gotejamento Dourado]|h|r aos jogadores atingidos.\n$bullet;O dano de |cFF2959D3|Hspell:469490|h[Tiro da Desgraça Dupla]|h|r é mitigado quanto mais perto estiver o jogador atingido.', 59888),
(30486, 'ptBR', 'Visão Geral', 'Gallywix ganha energia ao longo do tempo, ativando as |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r da Casa do Cromo na capacidade máxima. |cFF2959D3|Hspell:469362|h[Gigabombas Carregadas]|h|r levadas aos Gigacontroles acionam uma |cFF2959D3|Hspell:469767|h[Detonação da Gigabomba]|h|r. Isso causa um |cFF2959D3|Hspell:1220846|h[Derretimento do Controle]|h|r que interrompe as |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r do Gallywix. Quando os dois Gigacontroles são perdidos, uma |cFF2959D3|Hspell:1215209|h[Área de Sabotagem]|h|r se forma.\n\nAlém disso, ao longo da batalha, Gallywix convoca os Capangas Sombrafuso mais bem pagos para ajudá-lo.\n\nCom o avanço da batalha, Gallywix altera e aumenta o arsenal dele, levando a uma destruição frenética.$[14,15,17$ Ao chegar a 50% dos pontos de vida, Gallywix aprimora as capacidades dele para eliminar os jogadores de uma vez por todas. $]da batalha, Gallywix convoca os Capangas Sombrafuso mais bem pagos para ajudá-lo.\n\nCom o avanço da batalha, Gallywix altera e aumenta o arsenal dele, levando a uma destruição frenética.$[14,15,17$  Ao chegar a 50% dos pontos de vida, Gallywix aprimora as capacidades dele para eliminar os jogadores de uma vez por todas. $]', 59888),
(30082, 'ptBR', 'Curadores', '$bullet;Se duas fichas não forem depositadas ou uma combinação repetida for detectada durante |cFF2959D3|Hspell:461060|h[Girar para Vencer!]|h|r, o Bandido de Um Braço usa |cFF2959D3|Hspell:461068|h[Fraude Detectada!]|h|r.\n$bullet;A |cFF2959D3|Hspell:460164|h[Descarga Terrível]|h|r reduz a velocidade de movimento de todos os jogadores e absorve uma grande quantidade de cura.\n$bullet;Ficar perto da ficha de |cFF2959D3|Hspell:460181|h[Combinação Vencedora]|h|r concede |cFF2959D3|Hspell:460444|h[Figurão!]|h|r.', 59888),
(31381, 'ptBR', 'Seção 45', '', 59888),
(31380, 'ptBR', 'Seção 44', '', 59888),
(30951, 'ptBR', 'Curadores', '$bullet;As Bombas-relógio Armadas criadas pela |cFF2959D3|Hspell:460867|h[Grande Explosão]|h|r causam dano elevado a todos os jogadores, se expirarem.\n$bullet;|cFF2959D3|Hspell:459779|h[Atropelando Tudo]|h|r faz Bront correr para cima de qualquer objeto no caminho, inclusive as Bombas-relógio Armadas criadas pela |cFF2959D3|Hspell:460867|h[Grande Explosão]|h|r.\n$bullet;$[8,23|cFF2959D3|Hspell:473690|h[Gel Explosivo Cinético]|h|r joga para o alto Bombas Relógio Armadas próximas quando dissipado.$]', 59888),
(30950, 'ptBR', 'Tanques', '$bullet;As Bombas-relógio Armadas criadas pela |cFF2959D3|Hspell:460867|h[Grande Explosão]|h|r causam dano elevado a todos os jogadores, se expirarem.\n$bullet;|cFF2959D3|Hspell:459779|h[Atropelando Tudo]|h|r faz Bront correr através de qualquer objeto no caminho, inclusive as Bombas-relógio Armadas criadas pela |cFF2959D3|Hspell:460867|h[Grande Explosão]|h|r.', 59888),
(30949, 'ptBR', 'Causadores de Dano', '$bullet;As Bombas-relógio Armadas criadas pela |cFF2959D3|Hspell:460867|h[Grande Explosão]|h|r causam dano elevado a todos os jogadores, se expirarem.\n$bullet;|cFF2959D3|Hspell:459779|h[Atropelando Tudo]|h|r faz Bront correr para cima de qualquer objeto no caminho, inclusive as Bombas-relógio Armadas criadas pela |cFF2959D3|Hspell:460867|h[Grande Explosão]|h|r.\n$bullet;$[8,23|cFF2959D3|Hspell:473690|h[Gel Explosivo Cinético]|h|r joga para o alto Bombas Relógio Armadas próximas quando dissipado.$]', 59888),
