(31132, 'ptBR', 'Causadores de Dano', '$bullet;Kul\'tharok arranca almas de jogadores com |cFF2959D3|Hspell:473959|h[Atrair Alma]|h|r. Se as almas chegarem a Kul\'tharok, ele as infundirá em energia necrótica e causará |cFF2959D3|Hspell:474013|h[Corrupção da Alma]|h|r.\n$bullet;|cFF2959D3|Hspell:1216474|h[Espiral da Morte]|h|r cria um orbe de necromancia giratório que causa dano de Sombra aos jogadores ao contato.', 59888),
(28414, 'ptBR', 'Visão geral', 'O Mestre Fermentador Aldryr aproveita o poder explosivo do Cinzagris, atacando os jogadores com |cFF2959D3|Hspell:432198|h[Jorro Flamejante]|h|r e |cFF2959D3|Hspell:432182|h[Jogar Cinzagris]|h|r.\n\nCom 66% e 33% dos pontos de vida, o Mestre Fermentador Aldryr começa o |cFF2959D3|Hspell:442525|h[Happy Hour]|h|r e faz com que Clientes Sedentos soltem um |cFF2959D3|Hspell:431896|h[Urro Arruaceiro]|h|r.', 59888),
(22652, 'ptBR', 'Causadores de Dano', '$bullet;|cFF2959D3|Hspell:333292|h[Morte Calcinante]|h|r causa dano aos aliados próximos.\n$bullet;Ao chegar a 100 de energia, Paceram alveja os jogadores com |cFF2959D3|Hspell:320182|h[Esporos Nocivos]|h|r.', 59888),
(22650, 'ptBR', 'Tanque', '$bullet;|cFF2959D3|Hspell:320069|h[Golpe Mortal]|h|r reduz toda a cura recebida.\n$bullet;Ao chegar a 100 de energia, Paceram alveja os jogadores com |cFF2959D3|Hspell:320182|h[Esporos Nocivos]|h|r.', 59888),
(22279, 'ptBR', 'Seção 19', '', 59888),
(21890, 'ptBR', 'Seção 20', '', 59888),
