(21583, 'ptBR', 'Seção 8', '', 59888),
(21582, 'ptBR', 'Déssia, a Decapitadora', '', 59888),
(21581, 'ptBR', 'Paceram, o Virulento', '', 59888),
(21580, 'ptBR', 'Causadores de Dano', '$bullet;Ao ser derrotado, o desafiante tombado concede seu |cFF2959D3|Hspell:1215747|h[Último Desejo]|h|r aos desafiantes restantes.\n$bullet;|cFF2959D3|Hspell:333292|h[Morte Calcinante]|h|r causa dano a aliados próximos.\n$bullet;Ao chegar a 100 de energia, Paceram alveja os jogadores com |cFF2959D3|Hspell:320182|h[Esporos Nocivos]|h|r.', 59888),
(21579, 'ptBR', 'Curador', '$bullet;|cFF2959D3|Hspell:320069|h[Golpe Mortal]|h|r reduz toda a cura recebida.\n$bullet;|cFF2959D3|Hspell:333292|h[Morte Calcinante]|h|r causa dano a aliados próximos.\n$bullet;|cFF2959D3|Hspell:1215600|h[Toque Definhante]|h|r causa dano de Sombra continuamente aos jogadores atingidos até ser dissipado.', 59888),
(21577, 'ptBR', 'Visão Geral', 'Derrote os três desafiantes para provar seu valor. Cada desafiante usa uma habilidade poderosa quando chega a 100 de energia.', 59888),
(19233, 'ptBR', 'Tanques', '$bullet;Leve o Esbordoador de Platina até o alcance de |cFF2959D3|Hspell:282943|h[Esmaga-pistões]|h|r para remover aplicações de |cFF2959D3|Hspell:282801|h[Blindagem de Platina]|h|r.', 59888);
