INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2345, 'ptBR', 'Tufo-de-chá Miksi', '|cFFFFD200Loja do jogo|r|n', 'Tufos-de-chá são conhecidos pelos chás aromáticos. Porém, com sua vivacidade, eles trazem sempre o risco de chá derramado.', 59888),
(2344, 'ptBR', 'Pata-andante Miksi', '|cFFFFD200Loja do jogo|r|n', 'Pata-andantes se orgulham de servir chá. Eles estão sempre prontos para oferecer uma xícara quentinha para companheiros de viagem.', 59888),
(2343, 'ptBR', 'Pata-macia Miksi', '|cFFFFD200Loja do jogo|r|n', 'Pata-macias fornecem um chá preto ideal para dar aquela energia de manhã ou manter você de pé até mais tarde.', 59888),
(2342, 'ptBR', 'Pelo-eriçado Miksi', '|cFFFFD200Loja do jogo|r|n', 'Pelo-eriçados são brincalhões, atrapalhados e obcecados por limpeza. Uma combinação de características perigosa.', 59888),
(2489, 'ptBR', 'Borboleta Perolada', '|cFFFFD200Posto Comercial|r', 'Suba aos céus em uma borboleta cintilante, reluzente e perolada.', 59888),
(2288, 'ptBR', 'Goblin da S.U.C.A.T.A. Personalizado', '|cFFFFD200Saque:|r Pilha de Sucata Peneirada|n|cFFFFD200Área:|r Inframina', 'Retalhadores goblínicos já provaram várias vezes que têm muitas aplicações, como extração de madeira e transporte. Este modelo foi reprogramado para ser usado pela S.U.C.A.T.A.', 59888),
(2346, 'ptBR', 'Rouba-infusão Miksi', '|cFFFFD200Loja do jogo|r|n', 'Apesar da natureza travessa e brincalhona, estas criaturas são companheiras de viagem leais e confiáveis.', 59888),
(2296, 'ptBR', 'Aerogoblin do Imersor', '|cFFFFD200Missão Mundial: |rQuero meu chapéu de volta|n|cFFFFD200Área: |rIlha de Dorn|n|cFFFFD200Área: |rDornogal', 'Esta aeronave ajudará você a mergulhar direto na aventura, se não explodir!', 59888),
(2279, 'ptBR', 'Falha do Tambor Trovejante', '|cFFFFD200Comerciante: |rAndo, o Gato|n|cFFFFD200Área: |rLibertação da Inframina|n|cFFFFD200Custo: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'Obtida na geral do Caldeirão durante um confronto especialmente encarniçado. Quando foi perguntado se tinha falhado, o operador de Torq respondeu apenas: \"Parece que sim, né?\".', 59888),
(2276, 'ptBR', 'Nhocpactador de Sombrafuso', '|cFFFFD200Comerciante: |rAndo, o Gato|n|cFFFFD200Área: |rLibertação da Inframina|n|cFFFFD200Custo: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'Considerado o Maioral entre as hienas do Ferro-velho do Stix, sua mordida tem força suficiente para esmigalhar qualquer coisa, ou pessoa, em que Gallywix queira dar sumiço.', 59888),
(1471, 'ptBR', 'Vingança', '|cFFFFD200Saque:|r Grande Dama Sylvana Correventos|n|cFFFFD200Área:|r Sacrário da Dominação|n|cFFFFD200Modo:|r Mítico', 'Sylvana perdeu uma parte de si no dia em que Arthas lhe tirou a vida, e as trevas dentro dela cresceram para preencher o vazio.', 59888);
