UPDATE `broadcast_text_locale` SET `Text1_lang`='Todos os aprimoramentos exigem pedras da bravura, então é bom ficar de olho nelas.\n\nPara aprimorar equipamentos de Aventureiro, Veterano, Campeão, Herói ou Mito, geralmente também são necessários brasões. Você vai precisar de quinze brasões com o nível de poder apropriado para cada aprimoramento. Cazolth ou outro comerciante de aprimoramentos pode informar o tipo necessário.\n\nSe você trouxer um equipamento menos poderoso que outro já obtido para o mesmo espaço, o aprimoramento vai custar metade da quantidade normal de pedras da bravura, sem precisar de nenhum brasão. Então, por exemplo, se você já tiver uma capa poderosa, mas encontrar outra e quiser potencializá-la até o mesmo nível, será muito mais barato.', `VerifiedBuild`=59888 WHERE (`VerifiedBuild`>0 AND `ID`=265451 AND `locale`='ptBR');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Há pedras da bravura por toda Khaz Algar e embaixo dela. Elas podem ser obtidas ao abrir tesouros ao ar livre, concluir missões mundiais e participar de eventos semanais, imersões, masmorras e raides.\n\nBrasões podem ser obtidos de modo similar. Há quatro níveis de brasões. Quanto mais perigosa for a aventura que você superar, mais poderosos serão os brasões encontrados.', `VerifiedBuild`=59888 WHERE (`VerifiedBuild`>0 AND `ID`=265445 AND `locale`='ptBR');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Saudações, camarada!\n\nAgora que estamos em Dornogal há algum tempo, estamos vendo novos tipos de brasões aparecendo aqui e ali! Esses brasões da Inframina novos são artefatos impressionantes, que combinam muito bem com pedras da bravura.\n\nCazolth já pensou em uma forma de usá-los para aprimorar seu equipamento de aventureiro, é claro. Eu? Eu ainda estou trabalhando na transmutação dos brasões.\n\nComo sempre.\n\nAh, longe de mim reclamar. Eu gosto de ser útil para você e os outros aventureiros. Eu prefiro... ficar por aqui mesmo. Lutar não é exatamente minha especialidade.', `VerifiedBuild`=59888 WHERE (`VerifiedBuild`>0 AND `ID`=265441 AND `locale`='ptBR');
